import React from 'react';
import Post from './Post';
import { Link } from 'react-router-dom';

class PostList extends React.Component{

  constructor(props){
    super(props);
  }

  render(){
    return(
      <div>
        <Post date={"June 1st"} title={"First Post"} />
        <Link activeClassName="navbar__link--active" className="navbar__link" to={"/"+this.props.title}>Read More</Link>
        
      </div>
    )
  }
}

export default PostList
